import { combineReducers } from "redux";

import discoverReducer from "./discoverReducer";
import asianDramasReducer from "./asianDramasReducer";
import popularTVReducer from "./popularTVReducer";
import nowPlayingReducer from "./nowPlayingReducer";
import studioghibliReducer from "./studioghibliReducer";
import upcomingReducer from "./upcomingReducer";
import topRatedReducer from "./topRatedReducer";

export default combineReducers({
  movies: {
    discover: discoverReducer,
    nowPlaying: nowPlayingReducer,
    studioGhibli: studioghibliReducer,
    upcoming: upcomingReducer,
    topRated: topRatedReducer
  },
  tvs: {
    asianDramas: asianDramasReducer,
    popular: popularTVReducer
  }
});
